content="Ah, well! They may write such things in a book," Humpty Dumpty said in a calmer tone. "That's what you call a History of England, that is. Now, take a good look at me! I'm one that has spoken to a King, I am: mayhap you'll never see such another: and to show you I'm not proud, you may shake hands with me!" And he grinned almost from ear to ear, as he leant forwards (and as nearly as possible fell off the wall in doing so) and offered Alice his hand. She watched him a little anxiously as she took it. "If he smiled much more, the ends of his mouth might meet behind," she thought.

